import React, { Component } from "react";
import ProductItem from "./ProductItem";

class ProductList extends Component{

    showProduct(){
        if(this.props.products){
           return this.products.map(product=>(
                <ProductItem {...product}/>
            ))
        }
    }


    render(){
        return(
            <div className="row">
                {this.showProduct()}
            </div>
        )
    }
}

export default ProductList;
